import React from 'react';
import {NavLink} from 'react-router-dom';

const Menu = () =>{
    return ( 
        <>
           <NavLink to="/">About Us</NavLink>
           <NavLink to="/contact">contact</NavLink>
           <a href="/">About Us</a>
           <a href="/contact">contact</a>
        </>
    ) 
};

export default Menu;
